(32055, 92647, 3130, 1, '71489', '如果要找一組台灣最具代表性的Deathcore樂團，那麼這個位置絕非Beyond Cure莫屬！\r\n\r\n2006年成軍，經歷多任的團員汰換，使得彼此間的默契與實力也逐漸增強，到了現在，終於粹鍊出由主唱獨步、雙吉他老庚、米克、貝斯Larry以及鼓手小妖的最佳陣容，將其潛在的破壞力直衝到頂端！兼具猛爆且技巧性的編曲架構，和凶殘卻又不無病呻吟的詞句創作，徹底的將死蕊精神與信念發揚到淋漓盡致！\r\n\r\n距離EP「慢性潰爛」將近3年的時間，Beyond Cure終於帶著首張正式專輯「你的頭聞起來好香」回到熟悉的舞台前，要所有樂迷們見識到這集合凶悍、悲傷、邪惡、病態等元素於一身的全新毀滅能量，將現場那令人無法喘息的衝撞快感完整呈現。殺紅眼的死亡抽擊加上拳拳到肉的Breakdown痛歐，Beyond Cure不斷的替台灣Deathcore歷史開創新局，並再再的挑戰著自我極限之能耐。\r\n\r\n一張同時擁有視覺與聽覺雙重震撼的麤暴大碟已經擺在你的眼前了，你還有什麼理由去錯過？？ ', '2010-06-01 00:00:00', 2010, 0, 1, 9, '', '', 144, '', 'Beyond Cure ', 'Beyond Cure ', 'Beyond Cure ', '馬雅音樂', '', 1, 1, 0, '2011-01-25 11:03:23', '2015-03-12 13:45:39', '0000-00-00 00:00:00'),
