(32066, 66811, 0, 1, '反彈', '', '2011-01-25 00:00:00', 2000, 10, 0, 7, '給自己一個理由\r\n讓生活不再疑惑\r\n這是第幾次對自己說\r\n加油\r\n\r\n實現過的承諾太少\r\n犯過的錯太多\r\n也許一切可以重頭\r\n只要我原諒我\r\n\r\n日復一日的輾轉難眠\r\n不斷變化的現實社會\r\n該怎麼選擇去面對\r\n\r\n如果真的會有一天\r\n不用再去害怕改變\r\n但是我會離真實很遠\r\n\r\nHEY!\r\n為什麼我會被生下\r\n然後在徬徨中成長\r\n\r\n誰?\r\n可以清楚的回答\r\n就讓我繼續掙扎', '', 226, '', 'Fake Monkey全體工作人員', 'Fake Monkey全體工作人員', 'Fake Monkey全體工作人員', '', '', 0, 1, 0, '2011-01-25 14:42:18', '2015-03-12 13:45:39', '0000-00-00 00:00:00'),
