(32099, 90870, 3133, 1, '完啦完啦', '', '2010-12-01 00:00:00', 2000, 0, 2, 15, '完啦完啦\r\n\r\n你一動不動  似懂非懂的有點無厘頭\r\n攤開的雙手  捉不住風  吊在半空中\r\n\r\n一貫的沉默  就算犯錯  也無動於衷\r\n藏在角落  笑我  總愛沒事找事做\r\n\r\n你犯規啦  左看右看怎麼那麼傻\r\n熱情的海洋有那麼大  你偏偏要當皇帝守著心牆 糟啦糟啦\r\n你犯規啦  處罰讓你寂寞那麼長\r\n愛人沒有想像那麼難  不愛  那就完啦完啦\r\n完啦完啦 Oh No No 完啦完啦 Na Na Na Na  Oh~yeah~\r\n\r\n你真的完蛋啦  左看右看還是那麼傻\r\n熱情的海洋有那麼大  你偏偏要當皇帝守著心牆 糟啦糟啦\r\n你犯規啦  處罰讓你寂寞那麼長 oh~\r\n愛人沒有想像那麼難  不愛  那就~~完啦完啦完啦完啦完啦…\r\n', '', 256, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:12:57', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32100, 90870, 3133, 2, '王子麵', '', '2010-12-01 00:00:00', 2000, 0, 2, 7, '王子麵\r\n\r\n\r\n大晴天  我一個人獨自在家裡面\r\n\r\n看著連續劇重播好幾遍  抱怨著太陽大的好刺眼\r\n\r\n幸好這世上還有下雨天  是個好藉口躲在家裡面\r\n\r\n一包接著一包的王子麵  吃掉我為你蒼老的青春容顏\r\n\r\n\r\n偏偏我不去想  我不去想  你的壞只想你的好\r\n\r\n而我又認真想  又認真想  是不是我有哪裡沒做好\r\n\r\n但是這樣很不健康  很不健康  失戀就像灘爛泥巴\r\n\r\n只好就待在家  就待在家  消化一肚子的王子麵和你給的悲傷 \r\n( 這個曾經有你陪我的家 )\r\n\r\n\r\n\r\n這一天  是三百六十五天的關鍵\r\n\r\n眼看就快要過了十二點  等不到你的祝福和誓言\r\n\r\n不知不覺又過了好幾年  好死不死又想起你的臉\r\n\r\n陪我的剛好又是王子麵  吃了能否防腐我的青春容顏\r\n\r\n\r\n\r\n\r\n為什麼不去想  我不去想  你的壞只想你的好\r\n\r\n而我又認真想  又認真想  是不是我還對你不夠好\r\n\r\n但是這樣很不健康  很不健康  失戀就像灘爛泥巴\r\n\r\n只好就待在家  就待在家  消化一肚子的王子麵和你給的悲傷\r\n', '', 205, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:17:03', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32101, 90870, 3133, 3, '隱形的清流', '', '2010-12-01 00:00:00', 2000, 0, 2, 1, '隱形的清流\r\n\r\n\r\n你看著我   臉上充滿了疑惑\r\n眼神透露   我來自哪個星球\r\n在簡短的   自我介紹了以後\r\n不好意思我現在要佔領你的耳朵\r\n\r\nDi LaLa Di DA\r\nDi LaLa Di DA\r\nDi LaLa Di DA\r\n\r\n你要小心   被強迫吸食腐臭\r\n閉上眼聽   好多隱形的清流\r\n我很優秀   只是少了點噱頭\r\n莫非我的價值還不如你手中的啤酒 Oh~\r\n\r\n\r\n反啦反啦   決定造反啦\r\n管你管他   亂有亂的章法\r\n不上不下   炙熱的心臟\r\n撲通撲通   跳開既有的框架   (準備蓄勢待發)\r\n\r\n\r\n反啦反啦 你要小心  \r\n管你管他 閉上眼聽     \r\n不上不下 清流來襲  \r\n要你聽見 隱形的勢力\r\n\r\n\r\n反啦反啦   叛逆且優雅\r\n管你管他   癡狂本身無價\r\n不上不下   炙熱的心臟\r\n撲通撲通   跳開既有的框架\r\n', '', 192, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:24:01', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32102, 90870, 3133, 4, '慢半拍', '', '2010-12-01 00:00:00', 2000, 0, 2, 14, '慢半拍\r\n\r\n\r\n\r\n關於價值觀的絕對   大於是魁儡   小於是頹廢\r\n\r\n等於多數人的盲點   加於我類人   莫須有的罪\r\n\r\n至於我眼中的完美   在於求真切   多於求專業\r\n\r\n別催別催   寧可沉默以對\r\n\r\n\r\n\r\n有時候故意慢半拍   可想全世界唯我停擺\r\n\r\n若太陽也因怕冷而提早離開   為何我不能主宰前進的快慢\r\n\r\n有時候我想慢慢來   推倒預期未來的骨牌\r\n\r\n讓直覺指引到沉睡的狀態   下次睜開眼   我們重來\r\n\r\n\r\n\r\n故意慢半拍      唯我停擺\r\n\r\n若太陽也因怕冷而提早離開   為什麼我不能主宰前進的快慢\r\n\r\n有時候我想慢慢慢慢來   推倒預期未來的骨牌\r\n\r\n讓直覺指引到沉睡的狀態   下次睜開眼   我們重來\r\n', '', 222, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:31:24', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32103, 90870, 3133, 5, '小人國', '', '2010-12-01 00:00:00', 2000, 0, 2, 5, '小人國\r\n\r\n\r\n\r\n記憶中的小丑  抹滿嘴的口紅  手裡拿著氣球  輕跳  穿梭在人群中\r\n\r\n說謊的小木偶  旋轉的橡木桶  一口接著一口  甜蜜的香草濃\r\n\r\n\r\n\r\n你緊握我小手  擔心我會走丟  帶著我去感受  幸福蓋的彩虹\r\n\r\n\r\n\r\n有一種魔法  讓你微笑的魔法  閉上眼睛就能找到的力量 \r\n\r\n簡單多簡單  沮喪會得內傷  歡迎回到小人國 想想唯一的家\r\n\r\n有一個地方  讓你喘氣的地方  這裡你是永遠長不大的麻瓜\r\n\r\n從心再出發  別忘了要瘋狂  才會在回家的路上  有閃閃淚光\r\n\r\n\r\n\r\n妳迷人的瞳孔  你瀟灑的笑容  變成我右臉的酒窩  連心跳 都在同一個節奏\r\n\r\n偶爾覺得寂寞  全世界拒絕我  就想起小時候  是被疼愛的心頭肉\r\n\r\n\r\n\r\n又想起  奔跑的腳丫  飄灑的頭髮  累了  就睡著在你溫暖的肩膀\r\n\r\n手掌小小的  腦袋也小小的  這是我  小小的王國 \r\n', '', 291, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:34:33', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32104, 90870, 3133, 6, '365節', '', '2010-12-01 00:00:00', 2000, 0, 2, 5, '365節\r\n\r\n今天你不在家裡   忽高忽低的心情\r\n\r\n像直昇機   飛過天際   再降落在你手心裡\r\n\r\n明天你想去哪裡   我準備好了驚喜\r\n\r\n要送給你   逗你開心   有些話想告訴你\r\n\r\n\r\n1.	情人節要連續說三遍  寶貝我真的愛你\r\n\r\n2.	聖誕節要牽著手去買  你最喜歡的玩具\r\n\r\n3.	愚人節要趁你不注意  嚇你個措手不及\r\n\r\n4.	還要故意忘記你生日  再讓你感動不已\r\n\r\n5.	每個週年紀念日都要  複習回憶的點滴\r\n\r\n6.	週休二日別待在家裡  帶你到處去旅行\r\n\r\n7.	天天有你天天都值得  為了愛用盡全力\r\n\r\n8.	365節都要給你  最特別也最平凡的心\r\n', '', 250, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:39:29', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32105, 90870, 3133, 7, '老朋友', '', '2010-12-01 00:00:00', 2000, 0, 2, 5, '老朋友\r\n\r\n\r\n眉頭有發霉的徵兆\r\n\r\n我趕緊收拾要找樂子的背包\r\n\r\n三十分鐘後老地方聊聊  快幫我  撐個腰\r\n\r\n\r\n\r\n啤酒是爽口的解藥\r\n\r\n喝下去抓兔子笑聲地動天搖\r\n\r\n不必多說朋友是老的好  老的妙  老的呱呱叫\r\n\r\n\r\n\r\n就算睡不著吃不飽或只是很無聊   我知道不會少一個溫暖擁抱\r\n\r\n大事小事國事家事都不重要   但就愛湊一腳\r\n\r\n\r\n\r\n有你在雨天不怕沒搞頭  不怕昨天比今天好過\r\n\r\n找你敘敘舊不必太講究  最好醉翁之意就是酒\r\n\r\n好過歹過都享受生活    一起墮落也一起追夢\r\n\r\n為你唱首歌不必太感動  因為這樣看著我會害羞\r\n                       ( 因為這樣就足夠 ）\r\n', '', 203, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:42:46', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32106, 90870, 3133, 8, 'Star', '', '2010-12-01 00:00:00', 2000, 0, 2, 7, 'Star          \r\n\r\n是夜不夠深   我回不了神\r\n才讓一絲悔恨   佔滿此刻我的靈魂\r\n是我不夠誠懇   對於愛的可能\r\n給我機會坦承   我有多愚蠢\r\n\r\n\r\n因為你   是一顆Star\r\n因為你   是我的Star\r\n因為你   說起話來 知性 神秘\r\n望著你   我就言不及義\r\n\r\nI’m just me   But you  You are my star\r\n\r\nSo I’m praying that I can be the one in your eyes\r\n我愛你   卻是遙不可及\r\n\r\n\r\n因為你   說起話來 知性 神秘 Yeah~\r\n望著你   我就言不及義  oh~\r\n\r\nI’m just me   But you  You are my star\r\n\r\nSo I’m praying that I can be the one in your eyes\r\n我愛你   遙不可及\r\n', '', 280, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:48:20', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32107, 90870, 3133, 9, '別說穿了是為誰', '', '2010-12-01 00:00:00', 2000, 0, 2, 5, '別說穿了是為誰\r\n\r\n\r\n\r\n下雨天   像從前   你離開的那一夜\r\n\r\n一轉眼   才發現   又到了雨的季節\r\n\r\n空氣間   濕黏黏   是海水還是淚水\r\n\r\n聳個肩   抽根菸   懷念愛情的終點\r\n\r\n\r\nHey yeah~ \r\n\r\n你沒發覺   我又想起了你 整夜\r\n\r\n\r\n若看見了我流淚   別說穿了是為誰\r\n\r\n這不過是   自尊作祟   不需要給我安慰\r\n\r\n若看見了我喝醉   別說穿了是為誰\r\n\r\n怎麼面對   I only want you back\r\n\r\n\r\n\r\n下雨天   像從前   你離開的那一夜\r\n\r\n聳個肩   抽根菸   懷念愛情的終點\r\n', '', 289, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:52:18', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32108, 90870, 3133, 10, '流浪者', '', '2010-12-01 00:00:00', 2000, 0, 2, 5, '流浪者\r\n\r\n\r\n\r\n異鄉的月光  擁擠的土壤  未知的流浪下一站有幸福嗎?\r\n\r\n步伐的瀟灑  眼底的光芒  隨著時間流進海洋起伏消長\r\n                  \r\n你睡著了嗎? 正在想我嗎? 請相信你就是我唯一的牽掛\r\n\r\n我身在何方  心不曾迷惘  因為我知道你在等著我回家\r\n\r\n\r\n\r\n原諒我像風箏  天生就愛追高\r\n停不了的奔跑  以為有夢有美好\r\n\r\n我低著頭祈禱  想起你的懷抱\r\n倦鳥終將歸巢  完整生命中的缺角\r\n\r\nUm~~\r\n', '', 282, '', 'Connie呂莘', 'Connie呂莘', '周世暉/Connie呂莘', '喜國娛樂', '', 0, 1, 1, '2011-01-26 20:56:44', '2014-12-12 04:35:59', '2014-12-12 04:35:59'),
(32109, 93108, 0, 1, '紅心十(Live Version)', 'RedNoon夾band十年, 經過無數失敗失望, \r\n簽過數間唱片公司, 結果仍然失望, 十年來仍未能推出到自己的專輯.\r\n為了堅持我們的理想, 我們溜走了青春, 愛情, 金錢和時間...\r\n期間的辛酸, 就一字一筆寫在我們的這首新歌, \r\n用這歌告訴大家, 我們仍在努力奮鬥中.\r\nLive Version聲音絕無刪剪, 誠意與你分享! ', '2011-01-26 00:00:00', 2000, 0, 2, 1, '拼命了 腳壞了\r\n停在路口 被迫 當個觀眾\r\n\r\n縱幸免 生死劫\r\n如履薄冰 重覆 搜索起點\r\n\r\n人企在賽道起跑線\r\n槍聲已響 沿路 終點看不見\r\n誰人願意白走一遍\r\n\r\n你在變 我在變\r\n捱下去 夢想 可會變\r\n歲月已 坐上火箭\r\n難徒步 追出太空 創生天\r\n\r\n時間是最大的公證\r\n不可永生 怎可再等\r\n場場硬仗 絕處翻身\r\n(蠶蛾若燦爛過 那怕明燈撲火)\r\n\r\n幾多年 也未變 最硬朗 這張臉\r\n幾多次 跌入了 黑暗面\r\n清風兩袖 高呼照舊 紅色心跳動不變\r\n留住一口氣 為了一次衝線\r\n\r\n留住一口氣 誓要 衝衝衝\r\n衝開多少障礙 強橫地炸開\r\n鞋頭磨蝕上陣 行回頭路免問\r\n仍~亡命作十年的抗爭 ha~ \r\n(留住一口氣為了 一次衝線)', '', 233, '', '陳仲偉@RedNoon ', 'RedNoon', 'RedNoon', 'Red Star Music', '', 0, 1, 0, '2011-01-26 22:23:03', '2015-03-12 13:45:40', '0000-00-00 00:00:00'),
(32110, 93108, 0, 1, '八十革命(Live Version)', '無論你出生於那個年代，都應該起來講出心中所想所愛。\r\n\r\n', '2011-01-26 00:00:00', 2000, 0, 2, 1, '多失敗 長不大\r\n二十後 仲想依賴\r\n周遭勾畫我剪影\r\n講不出我的心聲\r\n\r\n我要壞 偏不壞\r\n想有理想 想有愛\r\n想你知道我的心裡\r\n想創一片天\r\n\r\n就讓八十革命\r\n用熱血來發聲\r\n不要等 不要諗 我不要忍\r\n我不要生命劃成直線\r\n\r\n命運注定對立\r\n大限殺絕無膽\r\n愛就愛就算被拒絕\r\n我亦照樣照直對你講\r\n\r\n心可賣 肝可賣\r\n白日夢別想出賣\r\n青春逼近了底線\r\n反增長倔強一點\r\n\r\n新一代 超想像\r\n若步伐夢想一樣\r\n使你知道眾多心裡\r\n都有一片天\r\n\r\n就讓八十革命\r\n用熱血來發聲\r\n不要等 不要諗 我不要忍\r\n我一放開讓熱情勁爆\r\n\r\n命運注定對立\r\n大限殺絕無膽\r\n愛就愛就算被拒絕\r\n我亦照樣照直對你講\r\n\r\n如沈默冷靜 都不等於做懦夫\r\n請你起身\r\n你有勇氣 未怕等 那怕死\r\n差一點講到嘴邊 用力去 Ha~\r\n\r\n就讓八十革命\r\n用熱血來發聲\r\n不再等 不再諗 我不再忍\r\n我一放開讓熱情勁爆\r\n\r\n命運注定對立\r\n大限殺絕無膽\r\n八十以後夾著使命\r\n發動革命我共你遠征\r\n\r\n去遠征 去遠征 再遠征\r\n\r\n', '', 223, '', '陳永康@RedNoon', 'RedNoon', 'RedNoon', 'Red Star Music', '', 0, 1, 0, '2011-01-26 22:30:30', '2015-03-12 13:45:40', '0000-00-00 00:00:00'),
(32111, 93108, 0, 1, '不死の戰機(Demo)', '無論你遇到什麼挫折，都要像這不死的戰機勇往直前。', '2011-01-26 00:00:00', 2000, 0, 2, 1, '天不怕 未見得會飛\r\n睇小我 逆向只逃避\r\n不甘要 自殺式炸死\r\n如雙手 當白布舉起 亦能 兇險化契機\r\n激起勇氣 天空配戰機 創造完美\r\n沖天不怕 沖走害怕\r\n著地有聲 未怕唾罵\r\n假使調頭 未迎戰\r\n白讓理想在腦後面 不見天？\r\n\r\n這一次 若襯早折返\r\n這一世 自信心會散\r\n請不要 讓暗黑彌漫\r\n如基因注定你天生異能 怎可以再等\r\n激起勇氣 不死の戰機 創造完美\r\n\r\n沖天不怕 沖走害怕\r\n著地有聲 未怕唾罵\r\n假使調頭 未迎戰\r\n白讓理想在腦後面 不見天？\r\n\r\n沖天不怕 沖走害怕\r\n擲地有聲 未怕唾罵\r\n不准調頭 就迎戰\r\n就讓理想在眼裡面 睇得見!', '', 227, '', '馬嘉均@RedNoon', 'RedNoon', 'RedNoon', 'Red Star Music', '', 0, 0, 1, '2011-01-26 22:32:11', '2013-10-07 17:17:56', '0000-00-00 00:00:00'),
