(32117, 93108, 0, 1, '打', '台上一分鐘, 台下十年功,\r\n做什麼都需要努力才可以成功, 你有否為自己的理想而努力?', '2011-01-27 00:00:00', 2000, 0, 2, 1, '招數變則通 通我脈衝 運氣打得中\r\n邦派本一家 演變莫測幻化出煙花\r\n\r\n吋勁練到氣勁似有若無 靈魂和軀體的深造\r\n怕我未怕 鍛鍊意志未怕 人人能給功夫點化\r\n\r\n勤練武功 打 資質出眾\r\n直拳快過北風 快恨準 我打\r\n嘿嘿嘿嘿 一身輕功 可殺敵破風\r\n\r\n保國與興家 不再戰爭 亂世給火化\r\n體格練得好 無必要瘦身 練武 天比高\r\n\r\n吋勁練到氣勁似有若無 靈魂和軀體的深造\r\n怕我未怕 鍛鍊意志未怕 人人能給功夫點化\r\n\r\n勤練武功 打 資質出眾\r\n直拳快過北風 快狠準 我打\r\n嘿嘿嘿嘿\r\n勤練武功 打\r\n\r\n(台上一分鐘 台下十年功\r\n想成功 睇你落幾多苦功\r\n師傅話練拳唔練功 到老一場空\r\n成功背後負出幾多努力 鍛鍊好堅定意志力\r\n要有無窮毅力 無人可以一朝登峰造極\r\n唯有繼續努力 繼續努力\r\ndadala dada dadadada打!)\r\n\r\n勤練武功 打 資質出眾\r\n直拳快過北風 快狠準 我打\r\n嘿嘿嘿嘿\r\n功夫 高 功夫 高 功夫 高 功夫 高\r\n打 要打得痛 \r\n南拳我最精通 快狠準 我打\r\n嘿嘿嘿嘿 一身輕功必可殺敵破風', '', 189, '', 'RedNoon', 'RedNoon', '陳德建/Rednoon', 'Red Star Music Company Limited', '', 0, 1, 0, '2011-01-27 01:31:41', '2015-03-12 13:45:40', '0000-00-00 00:00:00'),
