(32122, 58278, 0, 1, '血之1947-demo', '', '2011-01-27 00:00:00', 2011, 0, 2, 7, '日本投降\r\n台灣人民期待寄望\r\n祖國的人\r\n可以對阮疼愛\r\n誰知是夢\r\n一場悲哀惡夢\r\n1947 228\r\n \r\n冷血屠殺\r\n舉槍處決台灣人\r\n寶島染紅\r\n血流成江\r\n軍隊警察展流氓\r\n甘有人惜番薯子\r\n \r\n228 恨 那一天\r\n228 和  變成空\r\n228 戰  為尊嚴\r\n228 殺  殺殺殺\r\n \r\n枉死的我看無影\r\n枉死的我聽無聲\r\n在這個枉死城\r\n在這裡受折磨\r\n\r\n台灣是我的財產\r\n我要按怎就按怎\r\n別人的子死不完  \r\n反正恁攏支持我', '', 356, '', 'Derek & 背骨樂團', '614', '', '', '', 1, 1, 0, '2011-01-27 14:29:59', '2015-03-12 13:45:40', '0000-00-00 00:00:00'),
