(32149, 7548, 0, 1, '妳是不是我的最愛', '總是會想起妳,尤其是在早晨的那一瞬間...', '2011-01-27 00:00:00', 0000, 0, 2, 4, '鬧鐘的響起 早晨依然想起你的身影\r\n觀看著手機 關心的不是時間問題\r\n總帶把雨傘 期待下雨才能更靠近\r\n無聊的舉動 是為了吸引你的眼睛\r\n\r\nI never cry 笑著說你才會聽明白\r\nI wanna try 因為有你\r\n\r\n我是不是你的最愛\r\n不管別人怎麼說\r\n但你能給我溫柔的夢\r\n你應該是我的最愛\r\n不然每天的生活\r\n怎麼總有一點不自由\r\n\r\n每天都想著你\r\n好想對你說\r\n也對自己說\r\n\r\n', '', 298, '', '恩佑', '恩佑', '深層', '獨立', '', 0, 1, 0, '2011-01-27 22:29:19', '2015-03-12 13:45:41', '0000-00-00 00:00:00'),
(32150, 7548, 0, 1, '執著', '妳是否也在受傷的城市裡，享受著彼此的幻覺；\r\n當我退怯軟弱時，也只渴望一點能夠向前的力量..', '2011-01-27 00:00:00', 0000, 0, 2, 4, '左手 的藍圖\r\n交到右手手心\r\n即使是這麼短的距離\r\n也已然變調\r\n\r\n退去 的色彩\r\n模糊了的顏料\r\n再重新畫一張嗎?\r\n跟著腳步吧\r\n\r\n就快 趕不上歲月的流動\r\n嘗試著快樂一點\r\n不如學會不難過\r\n\r\n寧靜的話\r\n在喧囂的城市裡\r\n尋求 溫暖的擁抱\r\n我只需要一點點\r\n肯定自我的退讓\r\n\r\n全心的我\r\n在矛盾的心情裡\r\n尋找 部分的否定\r\n我只需要一點點\r\n能夠向前的力量 \r\n', '', 272, '', '恩佑', '恩佑', '深層', '獨立', '', 0, 1, 0, '2011-01-27 22:31:04', '2015-03-12 13:45:41', '0000-00-00 00:00:00'),
(32151, 7548, 0, 1, '過河', '人生要怎麼選擇才是對的?\r\n有時候我也只不過是摸著石頭過河.', '2011-01-27 00:00:00', 0000, 0, 2, 4, '終於嚐到了人生現實與冷酷了吧 感到對人性失望友情消逝了麼\r\n正處在人生巨變為何是自己變化 兩個自己陌生對立在受傷\r\n\r\n抱頭痛哭的夜晚 不帶希望的破曉\r\n感到了人生不平 卻不放手\r\n\r\n告訴自己要明瞭 明瞭不平才快樂\r\n我會學著摸石子過河 找一個出口\r\n\r\n用計畫告別變化 讓快樂替代徬徨\r\n我會學著摸石子過河 打造一個希望\r\n\r\n當束手無策時就換個角度去畫 需要帶刺的勇氣吧\r\n看牆腳花朵別徬徨 不讓自己再受傷 不讓自己再受傷\r\n\r\n', '', 328, '', '家豪', '家豪', '深層', '獨立', '', 0, 1, 0, '2011-01-27 22:32:42', '2015-03-12 13:45:41', '0000-00-00 00:00:00'),
